# use aes gcm as PRF RNG, randomly produce the random seeds (including its keys), and produce random hex of N bytes, and plot the distribution
#!pip install pycryptodome
import os
import secrets
import matplotlib.pyplot as plt
from cryptography.hazmat.primitives.ciphers import Cipher, algorithms, modes
from cryptography.hazmat.backends import default_backend

def aes_gcm_prf_rng(n_bytes, sample_size=10000):
    random_data = b''

    for _ in range(sample_size):
        # Generate random AES key (256-bit) and nonce (96-bit) securely
        key = secrets.token_bytes(32)  # 256-bit key
        nonce = secrets.token_bytes(12)  # 96-bit nonce

        # Initialize AES-GCM cipher
        cipher = Cipher(algorithms.AES(key), modes.GCM(nonce), backend=default_backend())
        encryptor = cipher.encryptor()

        # Generate random output
        plaintext = secrets.token_bytes(n_bytes)
        ciphertext = encryptor.update(plaintext) + encryptor.finalize()

        random_data += ciphertext[:n_bytes]  # Collect random bytes

    return random_data

def plot_distribution(random_data):
    # Convert binary data to a list of integers
    byte_values = list(random_data)

    plt.figure(figsize=(10, 6))
    plt.hist(byte_values, bins=256, range=(0, 256), density=True, color='blue', alpha=0.7)
    plt.title("AES-GCM PRF RNG Byte Distribution")
    plt.xlabel("Byte Value")
    plt.ylabel("Frequency")
    plt.grid(axis='y', linestyle='--', linewidth=0.5)
    plt.show()

if __name__ == "__main__":
    n_bytes = 32  # Length of random output
    random_data = aes_gcm_prf_rng(n_bytes)
    print("Generated random hex:", random_data.hex())
    print("random hex len:", len(random_data.hex())/2)
    plot_distribution(random_data)

